<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    
    <title>Delete Webhook</title>
    <style>
        body {
            background-color: rgb(15, 15, 15);
            color: white;
            font-family: Arial, sans-serif;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            height: 100vh;
            margin: 0;
            padding: 0;
        }

        h1 {
            margin-bottom: 19px;
        }

        .inp {
            display: flex;
            flex-direction: column;
            align-items: center;
            margin-bottom: 20px;
        }

        input[type="text"] {
            padding: 10px;
            font-size: 16px;
            width: 300px;
            border: none;
            background-color: rgba(255, 255, 255, 0.1);
            color: white;
            border-radius: 5px;
            outline: none;
        }

        input[type="text"]:focus {
            background-color: rgba(255, 255, 255, 0.2);
        }

        button {
            padding: 10px 20px;
            font-size: 18px;
            font-weight: 650;
            background-color: white;
            color: black;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            transition: transform .3s ease-in-out;
        }

        button:hover {
            background-color: white;
            font-weight: 650;
            font-size: 18px;
            transform: scale(1.1);
            transition: transform .3s ease-in-out;
        }
    </style>
</head>
<body>
    <div style="text-align: center;">
        <h1>Discord Webhook Deleter</h1>
        <div class="inp">
            <input type="text" id="inputwebhook" placeholder="Enter Webhook">

            <button id="delWenHook">Delete Webhook</button>
        </div>
    </div>
